import React from "react";
import "../../css/HomePage.css";

const Home = () => {
  return (
    <div className="home-container">
      <h1>Welcome to MyApp</h1>
      <p>Your personal health and fitness companion</p>
      <button className="cta-button">Get Started</button>
    </div>
  );
};

export default Home;
